import Catalogue from "./components/Catalogue";
import MainSlide from "./components/MainSlide";
import Popular from "./components/Popular";
import Sale from "./components/Sale";

function App() {
  return (
    <div className="App">
      <Navbar />
      <MainSlide />
      <Popular />
      <Sale />
      <Catalogue />
    </div>
  );
}

export default App;
